import React from "react"

export default function question(props){
    const [questions, setQuestions] = React.useState()
    React.useEffect(() => {
        fetch("https://api.imgflip.com/get_memes")
            .then(res => res.json())
            .then(data => console.log(data))
    }, [])


    const questionElements = questions
    return(
        <div>
            {questionElements}
        </div>
    )
}
